<!DOCTYPE html>
<html lang="fr">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>CRONOS – Planification & Gestion commerciale</title>
<style>
:root{--bg:#0f172a;--panel:#111827;--muted:#9aa4b2;--accent:#2563eb;--accent-2:#1e40af;--text:#e5e7eb}
*{box-sizing:border-box}html,body{height:100%}body{margin:0;font-family:ui-sans-serif,system-ui,-apple-system,Segoe UI,Roboto,Helvetica,Arial,Noto Sans; background:linear-gradient(180deg,#0b1220,#0f172a);color:var(--text)}
.view{display:none;height:100%;align-items:center;justify-content:center}.view.active{display:flex}.hidden{display:none!important}
.login-card{max-width:420px;width:100%;background:rgba(17,24,39,.85);padding:32px;border-radius:18px;box-shadow:0 10px 30px rgba(0,0,0,.35);backdrop-filter:blur(10px)}
.login-logo{display:block;width:80px;margin:0 auto 10px;filter:drop-shadow(0 4px 12px rgba(0,0,0,.25))}
h1{text-align:center;letter-spacing:2px;margin:6px 0 2px}.subtitle{text-align:center;color:var(--muted);margin:0 0 18px;font-size:14px}
label{display:block;font-size:14px;color:var(--muted);margin:12px 0 6px}input{width:100%;padding:12px 14px;border-radius:10px;border:1px solid #1f2937;background:#0b1020;color:var(--text);outline:none}
input:focus{border-color:var(--accent);box-shadow:0 0 0 3px rgba(37,99,235,.25)}
.btn-primary{margin-top:16px;width:100%;padding:12px 16px;border:none;border-radius:12px;background:linear-gradient(90deg,var(--accent),var(--accent-2));color:#fff;font-weight:600;cursor:pointer}
.btn-ghost{padding:8px 12px;border-radius:10px;background:transparent;border:1px solid #1f2937;color:var(--text);cursor:pointer}
.hint{font-size:12px;color:var(--muted);margin-top:10px;text-align:center}
.topbar{height:64px;background:#0b1020;border-bottom:1px solid #1f2937;display:flex;align-items:center;justify-content:space-between;padding:0 18px}
.topbar .brand{display:flex;align-items:center;gap:10px;font-weight:700;letter-spacing:1px}.topbar .brand img{width:32px;height:32px}
.userbox{display:flex;align-items:center;gap:10px;color:var(--muted)}
.app-shell{display:grid;grid-template-columns:240px 1fr;min-height:calc(100vh - 64px)}
.sidebar{background:#0b1020;border-right:1px solid #1f2937;padding:12px;display:flex;flex-direction:column;gap:6px}
.nav-link{display:block;padding:10px 12px;text-decoration:none;color:var(--text);border-radius:10px;border:1px solid transparent}
.nav-link:hover{background:#0f172a;border-color:#1f2937}.nav-link.active{background:#111827;border-color:#1f2937}
.page-container{padding:18px;background:radial-gradient(60% 60% at 50% 0%,rgba(37,99,235,.07),transparent 60%)}
.card{background:#0b1020;border:1px solid #1f2937;border-radius:14px;padding:16px;margin-bottom:14px}
.card h2{margin:0 0 10px}.grid{display:grid;grid-template-columns:repeat(12,1fr);gap:12px}.col-4{grid-column:span 4}.col-6{grid-column:span 6}.col-12{grid-column:span 12}
.badge{display:inline-block;padding:4px 8px;border-radius:999px;background:#111827;border:1px solid #1f2937;color:var(--muted);font-size:12px}
@media (max-width:900px){.app-shell{grid-template-columns:1fr}.sidebar{grid-row:2;flex-direction:row;overflow:auto}}
</style>
</head>

    <div class="userbox">
      <span id="user-info"></span>
      <button id="logout-btn" class="btn-ghost">Déconnexion</button>
    </div>
  </header>
  <div class="app-shell">
    <nav id="sidebar" class="sidebar">
      <a href="#/planifications" data-route="/planifications" class="nav-link">📅 Planifications</a>
      <a href="#/agents" data-route="/agents" class="nav-link">👤 Agents</a>
      <a href="#/commercial" data-route="/commercial" class="nav-link">💼 Gestion commerciale</a>
      <a href="#/internet" data-route="/internet" class="nav-link">🌐 Internet</a>
      <a href="#/parametrages" data-route="/parametrages" class="nav-link admin-only">⚙️ Paramétrages</a>
    </nav>

  </div>
</section>



<script>
const PAGES = {"/planifications": "\n<div class=\"card\">\n  <h2>Planifications<\/h2>\n  <p class=\"badge\">V1 \u2022 Structure pr\u00eate<\/p>\n  <p>Vue calendrier (\u00e0 venir) avec drag & drop, alertes de compl\u00e9tude, liste des agents \u00e0 affecter.<\/p>\n<\/div>\n<div class=\"grid\">\n  <div class=\"card col-6\">\n    <h3>Sites & prestations<\/h3>\n    <ul>\n      <li>Client \u2192 Sites \u2192 Prestations<\/li>\n      <li>Profils, Trames, Vacations<\/li>\n      <li>Indispo/Dispo agents<\/li>\n    <\/ul>\n  <\/div>\n  <div class=\"card col-6\">\n    <h3>Actions rapides<\/h3>\n    <button class=\"btn-ghost\">Cr\u00e9er un besoin<\/button>\n    <button class=\"btn-ghost\">Affectation auto<\/button>\n  <\/div>\n<\/div>\n", "/agents": "\n<div class=\"card\">\n  <h2>Agents<\/h2>\n  <p class=\"badge\">V1 \u2022 Structure pr\u00eate<\/p>\n  <p>Fiches agents (photo, \u00e9tat civil, contrat, dipl\u00f4mes, fichiers) & exports PDF param\u00e9trables.<\/p>\n<\/div>\n<div class=\"grid\">\n  <div class=\"card col-4\"><h3>Liste<\/h3><p>Tri/filtre + import/export (\u00e0 venir)<\/p><\/div>\n  <div class=\"card col-4\"><h3>Compteurs<\/h3><p>Heures, jours, primes (\u00e0 venir)<\/p><\/div>\n  <div class=\"card col-4\"><h3>Pr\u00e9paies<\/h3><p>Exports Excel (\u00e0 venir)<\/p><\/div>\n<\/div>\n", "/commercial": "\n<div class=\"card\">\n  <h2>Gestion commerciale<\/h2>\n  <p class=\"badge\">V1 \u2022 Structure pr\u00eate<\/p>\n  <p>Clients, Sites, Devis/Simulations, Facturation (forfaits, vacations), r\u00e8glements.<\/p>\n<\/div>\n<div class=\"grid\">\n  <div class=\"card col-6\"><h3>Clients & sites<\/h3><p>Fiches, contacts, pr\u00e9f\u00e9rences d'impression.<\/p><\/div>\n  <div class=\"card col-6\"><h3>Devis & factures<\/h3><p>Workflow brouillon \u2192 valid\u00e9 \u2192 avoir.<\/p><\/div>\n<\/div>\n", "/internet": "\n<div class=\"card\"><h2>Internet<\/h2>\n<p class=\"badge\">V1 \u2022 Structure pr\u00eate<\/p>\n<p>Gestion des demandes (par e-mail) et publication des plannings (portail).<\/p><\/div>\n", "/parametrages": "\n<div class=\"card\"><h2>Param\u00e9trages<\/h2>\n<p class=\"badge\">Admin uniquement<\/p>\n<ul><li>Agences (CRUD)<\/li><li>Utilisateurs & profils<\/li><li>Purge & journaux d\u2019audit<\/li><\/ul><\/div>\n"};

const $ = (sel) => document.querySelector(sel);
const loginView = $("#login-view");
const appView = $("#app-view");
const pageContainer = $("#page-container");
const userInfo = $("#user-info");
const logoutBtn = $("#logout-btn");

const DEMO_USERS = [
  { username: "admin", password: "admin", role: "admin", agency: "AUTRE" },
  { username: "agence", password: "agence", role: "agence", agency: "CASABLANCA" },
];

function seedUsers(){ if(!localStorage.getItem("cronos_users")) localStorage.setItem("cronos_users", JSON.stringify(DEMO_USERS)); }
function getUsers(){ return JSON.parse(localStorage.getItem("cronos_users")||"[]"); }
function setSession(user){ sessionStorage.setItem("cronos_session", JSON.stringify(user)); }
function getSession(){ try{return JSON.parse(sessionStorage.getItem("cronos_session"));}catch{return null;} }
function clearSession(){ sessionStorage.removeItem("cronos_session"); }

function showLogin(){ loginView.classList.add("active"); appView.classList.add("hidden"); appView.classList.remove("active"); }
function showApp(){ loginView.classList.remove("active"); appView.classList.remove("hidden"); appView.classList.add("active"); }

function renderNavForRole(role){
  document.querySelectorAll(".admin-only").forEach(el => el.style.display = (role==="admin") ? "block" : "none");
  const current = location.hash.replace("#","");
  document.querySelectorAll(".nav-link").forEach(a => a.classList.toggle("active", a.getAttribute("href")==="#" + current));
}

function loadPage(route){
  const html = PAGES[route] || PAGES["/planifications"];
  const user = getSession();
  if(route==="/parametrages" && user?.role!=="admin"){ pageContainer.innerHTML = '<div class="card"><h2>Accès refusé</h2><p>Réservé aux administrateurs.</p></div>'; renderNavForRole(user?.role); return; }
  pageContainer.innerHTML = html;
  renderNavForRole(user?.role);
}

function onRouteChange(){ const hash = location.hash || "#/planifications"; loadPage(hash.replace("#","")); }

async function tryFirebaseLogin(username, password){
  try{
    if(!window.fbAuth) return null;
    if(!username.includes("@")) return null;
    const cred = await window.fbSignIn(username, password);
    const uid = cred.user.uid;
    let role = "agence", agency = "AUTRE";
    try{ const data = await window.fbFetchRole(uid); if(data){ role = data.role==="admin" ? "admin":"agence"; agency = data.agency || agency; } } catch(e){}
    return { username, role, agency, uid };
  }catch(e){ console.warn("Firebase login failed", e); return null; }
}

function initLogin(){
  $("#login-form").addEventListener("submit", (e)=>{
    e.preventDefault();
    const username = $("#login-username").value.trim();
    const password = $("#login-password").value;
    tryFirebaseLogin(username, password).then(fbUser => {
      if(fbUser){ setSession(fbUser); userInfo.textContent = `${fbUser.username} • ${fbUser.role.toUpperCase()} • ${fbUser.agency}`; showApp(); location.hash = "#/planifications"; onRouteChange(); }
      else {
        const user = getUsers().find(u => u.username===username && u.password===password);
        if(!user) { alert("Identifiants invalides"); return; }
        setSession(user);
        userInfo.textContent = `${user.username} • ${user.role.toUpperCase()} • ${user.agency}`;
        showApp(); location.hash = "#/planifications"; onRouteChange();
      }
    });
  });
}

function initLogout(){
  logoutBtn.addEventListener("click", ()=>{ clearSession(); location.hash=""; showLogin(); });
}

// Boot
seedUsers(); initLogin(); initLogout();
const session = getSession(); if(session){ userInfo.textContent = `${session.username} • ${session.role.toUpperCase()} • ${session.agency}`; showApp(); onRouteChange(); } else { showLogin(); }
window.addEventListener("hashchange", onRouteChange);
</script>
